// who's the closest
// https://leetcode.com/discuss/interview-question/402031/ibm-oa-2019-whos-the-closest
function closest(s, arr) {
    for (let i = 0; i < arr.length; i++) {
        let index = arr[i];
        if (index > s.length) {
            console.log(-1);
            continue
        }

        let pointer = 1;
        let found = false;
        while((index - pointer >= 0) || (index+pointer < s.length)) {
            if(index-pointer >=0 && s[index-pointer] === s[index]) {
                found = true;
                console.log(index-pointer)
                break
            }
            if(index+pointer < s.length && s[index+pointer] === s[index]) {
                found = true;
                console.log(index+pointer)
                break
            }

            pointer++;
        }
        if (!found) console.log(-1)
    }
}

